import { Text } from ".";

const Vin = ({ bg, color, name }) => {
  return (
    <div className="w-52 h-72 bg-green-400 rounded-lg p-5">
      <div className={`w-1/2 h-2 rounded-xl bg-[${color}]`}></div>
      <Text.label color={"white"}>{name}</Text.label>
    </div>
  );
};

export { Vin };
